function Queue(){this.storage=[]}Queue.prototype.size=function(){return this.storage.length};Queue.prototype.enqueue=function(a){this.storage.push(a)};Queue.prototype.peek=function(){return this.storage[0]};Queue.prototype.dequeue=function(){return this.storage.shift()};Queue.prototype.putAtFront=function(a){this.storage.unshift(a)};
